import "./interfaces/IHasher.sol";

contract MerkleTree {
    uint256 public constant FIELD_SIZE =
        21888242871839275222246405745257275088548364400416034343698204186575808495617;

    // keccak256("tornado") % FIELD_SIZE
    uint256 public constant ZERO_VALUE =
        21663839004416932945382355908790599225266501822907911457504978515578255421292;

    uint32 public constant ROOT_HISTORY_SIZE = 100;

    IHasher public immutable hasher;
    uint256 public immutable numLevels;

    // the following variables are made public for easier testing and debugging and
    // are not supposed to be accessed in regular code
    // filledSubtrees and roots could be bytes32[size], but using mappings makes it cheaper because
    // it removes index range check on every interaction
    mapping(uint256 => bytes32) public filledSubtrees;
    mapping(uint256 => bytes32) public roots;

    uint32 public currentRootIndex;
    uint32 public nextIndex;

    constructor(uint256 numLevels_, address hasher_) {
        require(numLevels_ > 0, "Levels should be greater than zero");
        require(numLevels_ < 32, "Levels should be less than 32");
        numLevels = numLevels_;
        hasher = IHasher(hasher_);
        for (uint256 i = 0; i < numLevels; i++) {
            filledSubtrees[i] = zeros(i);
        }
        roots[0] = zeros(numLevels);
    }

    function hashLeftRight(bytes32 left, bytes32 right)
        public
        view
        returns (bytes32)
    {
        require(uint256(left) < FIELD_SIZE, "Left should be inside the field");
        require(
            uint256(right) < FIELD_SIZE,
            "Right should be inside the field"
        );

        bytes32[2] memory input;
        input[0] = left;
        input[1] = right;

        return hasher.poseidon(input);
    }

    function _insert(bytes32 leaf) internal returns (uint32 index) {
        uint32 _nextIndex = nextIndex;
        require(_nextIndex != 2**numLevels, "Merkle tree is full");

        uint32 currentIndex = _nextIndex;
        bytes32 currentLevelHash = leaf;
        bytes32 left;
        bytes32 right;

        for (uint32 i = 0; i < numLevels; i++) {
            if (currentIndex % 2 == 0) {
                left = currentLevelHash;
                right = zeros(i);
                filledSubtrees[i] = currentLevelHash;
            } else {
                left = filledSubtrees[i];
                right = currentLevelHash;
            }

            // Current level hash accumulates hashes from bottom to top.
            // At top it becomes the root of merkle tree.
            currentLevelHash = hashLeftRight(left, right);

            // This alternates the nodes (left and right) at each level.
            currentIndex /= 2;
        }

        // Older roots are overwritten by newer ones when size limit hits ROOT_HISTORY_SIZE.
        uint32 newRootIndex = (currentRootIndex + 1) % ROOT_HISTORY_SIZE;
        currentRootIndex = newRootIndex;
        roots[newRootIndex] = currentLevelHash;
        nextIndex = _nextIndex + 1;
        return _nextIndex;
    }

    /**
     * @dev Whether the root is present in the root history
     */
    function isKnownRoot(bytes32 root) public view returns (bool) {
        if (root == 0) {
            return false;
        }
        uint32 _currentRootIndex = currentRootIndex;
        uint256 i = _currentRootIndex;
        do {
            if (root == roots[i]) {
                return true;
            }
            if (i == 0) {
                i = ROOT_HISTORY_SIZE;
            }
            i--;
        } while (i != _currentRootIndex);
        return false;
    }

    function getLastRoot() public view returns (bytes32) {
        return roots[currentRootIndex];
    }

